snippet.description:
Speriamo sia una bella domenica per voi. Per me non lo sarà molto, visto che sono insonne da due notti consecutive e rischio di impazzire (Raiden). E Midnina non sta benissimo (ma nulla di grave, sembra). Però, immancabili, ecco le NEWS DELLA SETTIMANA. Quelle non le toglie di mezzo nessuno.

INDICE DELLE #NEWS VIDEOGIOCHI:
0:00 - Intro con parte di una notizia;
0:23 - Sony vuole aprirsi anche a Nintendo e Xbox per i suoi giochi?
2:58 - Secondo gli analisti "le esclusive non attirano più verso una piattaforma";
4:18 - Annunciato e mostrato ufficialmente Battlefield 6;
4:37 - Sandfall (Clair Obscur) sono andati da Kojima e da Square Enix;
5:00 - La censura si abbatte sui videogiochi, per volere delle compagnie di gestione dei pagamenti;
6:51 - Dying Light The Beast rinviato a settembre;
7:08 - Stop Destroying Videogames: il CEO di Ubisoft dice che "nulla è eterno";
8:19 - Stop Destroying Videogames: Notch (Minecraft) vorrebbe sostenere anche economicamente il progetto (?);
8:58 - Assassin's Creed Shadows: presentato il DLC "Claws of Awaji" con data d'uscita;
9:24 - Microsoft prima aumenta il prezzo dei suoi giochi, poi ci ripensa;
10:23 - Elden Ring Nightreign: arriva la modalità per due giocatori;
10:48 - Epic Games Store: ecco i giochi GRATIS dal 31 luglio 2025;
10:55 - NEWS A RAFFICA;
14:29 - Saluti e dissing a Midna che sta poco bene ma dissing lo stesso.

…
- Raiden & Midna

